package com.ruida.springbootdemo.test;

/**
 * @description:
 * Q：字符串长度是否有限制?是多少?
 * A：首先字符串的内容是由一个字符数组char[]来存储的，由于数组的长度及索引是整数，
 * 且string类中返回字符串长度的方法length()的返回值也是int，通过查看java源码中
 * 的类Integer可以看到Integer的最大范围是2^31-1，由于数组是从0开始的，所以数组
 * 的最大长度是[0-2^31]。
 *    但是通过翻阅Java虚拟机手册对class文件格式的定义以及常量池中对string类型结
 * 构体的定义我们可以知道对于索引定义u2，就是无符号占2个字节，2个字节可以表示的最
 * 大范围是2^16-1=65535。
 *    但是由于jvm需要一位表示结束指令，所以这个范围就为65534。超出这个范围编译时
 * 期就会报错，但是运行时拼接或者赋值的范围就是在整型的最大范围中。
 * @author: chenjy
 * @create: 2020-11-25 10:44
 */
public class StringLengthTest {
    public static void main(String[] args) {
        String str = "";
        System.out.println(str);
    }
}
